import React, { useEffect } from "react";

const Dashboard = () => {
  useEffect(() => {}, []);
  return (
    <div className="row">
      <div className="col-md-12">
        <div className="kt-section">
          <h1>demo</h1>
        </div>
      </div>
    </div>
  );
};


export default Dashboard;
